import React from "react";
import {AppBar, Box, Container, Grid, Paper, Tab, Tabs, Typography} from "@material-ui/core";
import './Default.scss';
interface TabPanelProps {
    children?: React.ReactNode;
    index: any;
    value: any;
}

export function Product() {
    return (
        <div className='products-wrap'>
            <div className='hero-area'>
                <Container>
                    1
                </Container>
            </div>
            <div className='icon-area'>
                <Container>
                    <Typography variant="h5" align="center">Welcome to DV ONLINE Banking</Typography>
                    <Grid container spacing={3}>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                    </Grid>
                </Container>
            </div>
            <div className='benefit-area'>
                <Container>
                    3
                </Container>
            </div>
            <div className='products-area'>
                <Container>

                </Container>
            </div>
            <div className='volunteer-area'>
                <Container>

                </Container>
            </div>
        </div>
    );
}

export function Event() {
    const [value, setValue] = React.useState(0);
    const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
        setValue(newValue);
    };
    const handleChangeIndex = (index: number) => {
        setValue(index);
    };
    return (
        <Container component="main" maxWidth='lg' className='event-wrap'>
            <AppBar position="static" color="default">
                <Tabs
                    value={value}
                    onChange={handleChange}
                    indicatorColor="primary"
                    textColor="primary"
                    variant="fullWidth"
                    aria-label="full width tabs example"
                >
                    <Tab label="Item One"/>
                    <Tab label="Item Two"/>
                    <Tab label="Item Three"/>
                </Tabs>
            </AppBar>
        </Container>
    );
}

export function FAQ() {
    return (
        <div className='faq-wrap'>
            <div className='hero-area'>
                <Container>
                    1
                </Container>
            </div>
        </div>
    );
}

function TabPanel(props: TabPanelProps) {
    const { children, value, index, ...other } = props;

    return (
        <Typography
            component="div"
            role="tabpanel"
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && <Box p={3}>{children}</Box>}
        </Typography>
    );
}

function a11yProps(index: any) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}
